import React, { useEffect, useState } from "react";
import logo1 from "../assets/AWES_Logo.png";
import logo3 from "../assets/logo.svg";
import logo2 from "../assets/Ait.png";
import logo4 from "../assets/Ait.svg";
import { results } from "../data/Result";
import { useAuth } from "../context/AuthContext";
import { creds } from "../data/creds.ts";
import { jsPDF } from "jspdf";
import "../assets/Poppins-Regular.ttf"
import "../assets/Montserrat-Regular.ttf"
import { setFontAndSize } from "pdf-lib";

const Dashboard: React.FC = () => {
  const { username } = useAuth();
  const [schoolName, setSchoolName] = useState<string | null>(null);
  const [students, setStudents] = useState<any[]>([]);

  useEffect(() => {

    const user = creds.find((cred) => cred.username === username);
    if (user) {
      setSchoolName(user.schoolName);
      console.log(user.schoolName)
    }

   
    const matchedSchool = results.find(
      (schoolData) => schoolData.schoolID === username
    );
    
    if (matchedSchool) {
      setStudents(matchedSchool.students);
    }
  }, [username]);

  const generatePDF = () => {
    const doc = new jsPDF();
    
    const margin = 20;
    let yPosition = margin;
    const logoBase64 = "data:image/svg+xml;base64,";
        const logo1Base64 = "data:image/svg+xml;base64,iVBORw0KGgoAAAANSUhEUgAAAiQAAAAHCAYAAAA4VFbBAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAABcSURBVHgB7dY5AcJAFAXAt4cAjOABCThBBIZAQawkDtKn2Mj4zYyKac/v9k7PIwAABcaV3+xtfrLyCgBAhZG9BwCgmJAAAOWEBAAoJyQAQLm5sv5ZOQIAUKD1cd5VpQuuyAOykwAAAABJRU5ErkJggg==";
    const yShift = 50; 

    doc.addImage(logoBase64, "PNG", margin - 20, margin-20, 210, 50); // Adjust size and position
    doc.addImage(logo1Base64, "PNG", margin -10 , margin + 250, 190, 2); // Adjust size and position
    doc.addFileToVFS("Montserrat-Regular.ttf", "base64EncodedFontString"); // Add the font file
    doc.addFont("Montserrat-Regular.ttf", "poppins", "normal"); // Map the font name
    
    doc.setFont("poppins");
    doc.setFontSize(24);
    doc.setFillColor(46, 113, 238); 
    doc.text("Congratulations", margin, yPosition + yShift + 0);
    yPosition += 10;
    doc.setFont("poppins", "normal");
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0);
    const congratsText = [
      "The following students have successsfully qualified for the Next Round ",
      "Keep up the great work and continue striving for excellence!",
      "We are so proud of your hard work and dedication."
    ];
    
    congratsText.forEach(text => {
      doc.text(text, margin, yPosition + yShift);
      yPosition += 6;
    });
    yPosition += 5;
   
    doc.setFont("poppins");
    doc.setFontSize(12);
    doc.text(schoolName || `School ID: ${username}`, margin, yPosition + yShift);
    yPosition += 3;
    doc.setLineWidth(0.5);
    yPosition += 10;
    
    const tableStartY = yPosition + yShift;
    const columns = ["Username", "Student Name", "Category"];
    const columnWidths = [60, 60, 60];
    const cellPadding = 5;
    const rowHeight = 10;
    
    doc.setFillColor(47, 132, 195); 
    doc.setTextColor(255, 255, 255); 
    doc.rect(margin, yPosition + yShift - 7, 170, rowHeight, 'F');
    
    let xPosition = margin + cellPadding;
    columns.forEach((column, index) => {
      doc.text(column, xPosition, yPosition + yShift);
      xPosition += columnWidths[index];
    });
    yPosition += rowHeight;
    

    doc.setTextColor(0, 0, 0);
    doc.setFont("poppins");
    students.forEach((student, index) => {
      if (index % 2 === 0) {
        doc.setFillColor(240, 240, 240);
        doc.rect(margin, yPosition + yShift - 7, 170, rowHeight, 'F');
      }
      
      xPosition = margin + cellPadding;
      doc.text(student.username, xPosition, yPosition + yShift);
      xPosition += columnWidths[0];
      doc.text(student.name, xPosition, yPosition + yShift);
      xPosition += columnWidths[1];
      doc.text(student.class === "VI-VII" ? "Category 1" : "Category 2", xPosition, yPosition + yShift);
      
      yPosition += rowHeight;
      
      // Add new page if needed
      if (yPosition > 280) {
        doc.addPage();
        yPosition = margin;
      }
    });
    
    doc.text("Warm Regards, ",margin, yPosition+90);
    doc.text("Team myAimate ",margin, yPosition+96);
    doc.setFontSize(12);
    // Draw table border
    doc.setLineWidth(0.2);
    doc.rect(margin, tableStartY - 7, 170, (students.length + 1) * rowHeight, 'S');
    
    // Add footer
    doc.setFontSize(8);
    doc.setTextColor(128, 128, 128);
    const today = new Date().toLocaleDateString();
    doc.text(`Generated on: ${today}`, margin, 290);
    
    doc.save("Round_1_Results.pdf");
  };
  return (
    <div className="min-h-screen bg-gray-50">
      <nav className="bg-white shadow-lg">
        <div className="max-w-7xl mx-auto px-6">
          <div className="flex justify-between items-center h-20">
            <img src={logo3} alt="Logo" className="h-12 w-auto" />
            <img src={logo4} alt="AWES Logo" className="h-12" />
          </div>
        </div>
      </nav>

      <div className="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-12">
          <h1 className="text-4xl font-bold text-gray-800 mb-3">Round 1 Results</h1>
          <p className="text-lg text-gray-600">
            Congratulations! These students have successfully qualified for the second round
          </p>
        </div>
        <div className=" text-black text-2xl font-bold flex justify-center items-center pb-10">
          {schoolName ? schoolName : "Loading school name..."}
        </div>

        {students.length === 0 ? (
          <div className="text-center py-12">
            <h2 className="text-2xl font-bold text-gray-800 mb-3">Every setback is a setup for a comeback. You’ve got this!</h2>
            <p className="text-lg text-gray-600">Believe in yourself—the journey has just begun.</p>
            <p className="mt-4 text-lg font-semibold text-red-600">
              Your school is not selected for round 2.
            </p>
          </div>
        ) : (
          <div className="bg-white rounded-xl shadow-lg overflow-hidden border border-gray-200">
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gradient-to-r from-blue-500 to-blue-600">
                  <tr>
                    <th className="px-6 py-4 text-left text-sm font-semibold text-white uppercase tracking-wider">
                      Username
                    </th>
                    <th className="px-6 py-4 text-left text-sm font-semibold text-white uppercase tracking-wider">
                      Student Name
                    </th>
                    <th className="px-6 py-4 text-center text-sm font-semibold text-white uppercase tracking-wider">
                      Category
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {students.map((student, index) => (
                    <tr key={index} className="hover:bg-gray-50 transition-colors duration-200">
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center">
                          <span className="text-sm text-gray-900">{student.username}</span>
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className="text-sm font-medium text-gray-900">{student.name}</span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-center">
                        <span className="px-3 py-1 inline-flex text-sm leading-5 font-semibold text-blue-800">
                          {student.class === "VI-VII" ? "Category 1" : "Category 2"}
                        </span>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
        {students.length > 0 && (
          <div className="flex justify-center mt-8">
            <button
              onClick={generatePDF}
              className="px-6 py-2.5 bg-blue-500 text-white rounded-lg hover:bg-blue-600 transition-all duration-300 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 shadow-md hover:shadow-lg"
            >
              Download Results
            </button>
          </div>
        )}

      </div>
    </div>
  );
};

export default Dashboard;
